    public class DBAsyncTask extends AsyncTask<String, Void, String> {
        protected void onPreExecute() {
            SplashScreenActivity.this.spinner.setVisibility(0);
        }

        protected String doInBackground(String... params) {
            if (!SplashScreenActivity.this.crearPeajeHorario()) {
                Log.i(SplashScreenActivity.LOGTAG, "debe dormir 2 segundos");
                try {
                    Thread.sleep(1000);
                } catch (InterruptedException e) {
                    e.printStackTrace();
                }
            }
            Log.i(SplashScreenActivity.LOGTAG, "fin doInBackground ");
            return null;
        }

        protected void onPostExecute(String result) {
            Log.i(SplashScreenActivity.LOGTAG, "inicio onPostExecute");
            SplashScreenActivity.this.startActivity(new Intent(SplashScreenActivity.this.getBaseContext(), MenuActivity.class));
            Log.i(SplashScreenActivity.LOGTAG, "fin onPostExecute");
            SplashScreenActivity.this.finish();
            SplashScreenActivity.this.spinner.setVisibility(8);
        }

        protected void onProgressUpdate(Void... values) {
        }
    }

    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_splash_screen);
        this.datasource = new PeajesDataSource(this);
        Log.i(LOGTAG, "OMCREATE");
        this.spinner = (ProgressBar) findViewById(R.id.progressBar1);
        this.spinner.setVisibility(8);
        new DBAsyncTask().execute(new String[0]);
    }

    public boolean crearPeajeHorario() {
        this.datasource.openDB();
        Log.i(LOGTAG, "iinicio crear peajes y horarios");
        if (this.datasource.getCountPeaje() == 0 || this.datasource.getCountHorario() == 0) {
            insertarPeajes();
            insertarHorarios();
            this.datasource.closeDB();
            return true;
        }
        Log.i(LOGTAG, "Ya se insertó peajes:" + this.datasource.getCountPeaje());
        Log.i(LOGTAG, "Ya se insertó horarios: " + this.datasource.getCountHorario());
        return false;
    }

